import { Card, Col, Row, Skeleton } from 'antd';
import React from 'react';

function LoadingGridView(props) {
	return (
		<Row gutter={[16, 16]}>
			<Col span={6} xs={24} sm={24} md={12} lg={8} xl={6}>
				<Card
					style={{ width: '100%' }}
					cover={<img src={require('../../assets/images/loadingImage.png')} />}
				>
					<Skeleton active={true} paragraph={{ rows: 3 }} />
				</Card>
			</Col>
		</Row>
	);
}

export default LoadingGridView;
